INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5, "", 2, 104801, 0, 0, 0, 1, "ミフユ", 80001, 43);
