INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6, "", 2, 103201, 0, 0, 0, 0, "アキノ", 80001, 45);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6, "", 1, 103401, 0, 0, 0, 1, "ユカリ", 80001, 46);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6, "", 2, 103401, 0, 0, 0, 1, "ユカリ", 80001, 47);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7, "", 1, 107101, 0, 0, 0, 0, "クリスティーナ", 80001, 48);
