INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7, "", 1, 104701, 0, 0, 0, 1, "ジュン", 80001, 50);
