INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8, "", 1, 103701, 0, 0, 0, 0, "トモ", 80001, 52);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これからもよろしくね！", 8, "", 2, 103701, 0, 0, 0, 0, "トモ", 80001, 53);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8, "", 1, 100501, 0, 0, 0, 1, "マツリ", 80001, 54);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8, "", 2, 100501, 0, 0, 0, 1, "マツリ", 80001, 55);
