INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9, "", 2, 100701, 0, 0, 0, 0, "ミヤコ", 80001, 57);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9, "", 1, 103101, 0, 0, 0, 1, "シノブ", 80001, 58);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9, "", 2, 103101, 0, 0, 0, 1, "シノブ", 80001, 59);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10, "", 1, 100901, 0, 0, 0, 0, "アンナ", 80001, 60);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10, "", 2, 100901, 0, 0, 0, 0, "アンナ", 80001, 61);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("君と出会ってもう1年だって！\n早いねー！", 10, "", 1, 101301, 0, 0, 0, 1, "ナナカ", 80001, 62);
