INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11, "", 1, 105101, 0, 0, 0, 0, "ミツキ", 80001, 64);
