INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, "", 1, 104201, 0, 0, 0, 1, "チカ", 80001, 72);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 12, "", 2, 104201, 0, 0, 0, 1, "チカ", 80001, 73);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, "", 1, 102101, 0, 0, 0, 2, "クルミ", 80001, 74);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, "", 2, 102101, 0, 0, 0, 2, "クルミ", 80001, 75);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, "", 1, 104901, 0, 0, 0, 0, "シズル", 80001, 76);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, "", 2, 104901, 0, 0, 0, 0, "シズル", 80001, 77);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, "", 1, 101101, 0, 0, 0, 1, "リノ", 80001, 78);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, "", 2, 101101, 0, 0, 0, 1, "リノ", 80001, 79);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, "", 1, 100201, 0, 0, 0, 0, "ユイ", 80001, 80);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, "", 2, 100201, 0, 0, 0, 0, "ユイ", 80001, 81);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, "", 1, 100101, 0, 0, 0, 1, "ヒヨリ", 80001, 82);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, "", 2, 100101, 0, 0, 0, 1, "ヒヨリ", 80001, 83);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, "", 1, 100301, 0, 0, 0, 2, "レイ", 80001, 84);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キミに背中を預けられる日が、\n早くきますように", 14, "", 2, 100301, 0, 0, 0, 2, "レイ", 80001, 85);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, "", 1, 105801, 0, 0, 0, 0, "ペコリーヌ", 80001, 86);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これからもずっと、覚えていて\nくださいね！", 15, "", 2, 105801, 0, 0, 0, 0, "ペコリーヌ", 80001, 87);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, "", 1, 105901, 0, 0, 0, 1, "コッコロ", 80001, 88);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, "", 2, 105901, 0, 0, 0, 1, "コッコロ", 80001, 89);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, "", 1, 106001, 0, 0, 0, 2, "キャル", 80001, 90);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, "", 2, 106001, 0, 0, 0, 2, "キャル", 80001, 91);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, "", 1, 112101, 0, 0, 1, 1, "スズメ", 60001, 92);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, "", 0, 0, 0, 1, 1, 2, "", 60001, 93);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, "", 0, 0, 0, 1, 1, 2, "", 60001, 94);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, "", 0, 0, 0, 1, 1, 2, "", 60001, 95);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, "", 0, 0, 0, 1, 1, 2, "", 60001, 96);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, "", 0, 0, 0, 1, 2, 2, "", 60001, 97);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, "", 0, 0, 0, 2, 1, 2, "", 60001, 98);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, "", 0, 0, 0, 2, 1, 2, "", 60001, 99);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, "", 0, 0, 0, 2, 1, 2, "", 60001, 100);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, "", 0, 0, 0, 2, 1, 2, "", 60001, 101);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, "", 0, 0, 0, 2, 2, 2, "", 60001, 102);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 103);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 104);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 105);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 106);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 107);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, "", 0, 0, 0, 3, 1, 2, "", 60001, 108);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, "", 0, 0, 0, 3, 2, 2, "", 60001, 109);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 110);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 111);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 112);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 113);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 114);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, "", 0, 0, 0, 4, 1, 2, "", 60001, 115);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, "", 0, 0, 0, 4, 2, 2, "", 60001, 116);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, "", 2, 112101, 0, 0, 0, 3, "スズメ", 60001, 117);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, "", 3, 112101, 0, 0, 0, 3, "スズメ", 60001, 118);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 1, "", 1, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 119);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, "", 1, 105901, 0, 0, 0, 1, "コッコロ", 80003, 120);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, "", 2, 105901, 0, 0, 0, 1, "コッコロ", 80003, 121);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("え？　ちょっと\nいきなりなにっ？", 1, "", 1, 106001, 0, 0, 0, 2, "キャル", 80003, 122);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, "", 2, 106001, 0, 0, 0, 2, "キャル", 80003, 123);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, "", 2, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 124);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, "", 3, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 125);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 1, "", 3, 105901, 0, 0, 0, 1, "コッコロ", 80003, 126);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, "", 3, 106001, 0, 0, 0, 2, "キャル", 80003, 127);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, "", 4, 105901, 0, 0, 0, 1, "コッコロ", 80003, 128);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, "", 4, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 129);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, "", 4, 106001, 0, 0, 0, 2, "キャル", 80003, 130);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, "", 5, 105901, 0, 0, 0, 1, "コッコロ", 80003, 131);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, "", 5, 106001, 0, 0, 0, 0, "キャル", 80003, 132);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, "", 1, 190801, 0, 0, 0, 1, "カリン", 80003, 133);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 2, "", 6, 106001, 0, 0, 0, 0, "キャル", 80003, 134);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, "", 2, 190801, 0, 0, 0, 1, "カリン", 80003, 135);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, "", 7, 106001, 0, 0, 0, 0, "キャル", 80003, 136);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, "", 3, 190801, 0, 0, 0, 1, "カリン", 80003, 137);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, "", 8, 106001, 0, 0, 0, 0, "キャル", 80003, 138);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, "", 9, 106001, 0, 0, 0, 0, "キャル", 80003, 139);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, "", 4, 190801, 0, 0, 0, 1, "カリン", 80003, 140);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, "", 10, 106001, 0, 0, 0, 0, "キャル", 80003, 141);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, "", 5, 190801, 0, 0, 0, 1, "カリン", 80003, 142);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, "", 11, 106001, 0, 0, 0, 0, "キャル", 80003, 143);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, "", 6, 105901, 0, 0, 0, 0, "コッコロ", 80003, 144);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, "", 5, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 145);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, "", 7, 105901, 0, 0, 0, 0, "コッコロ", 80003, 146);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, "", 8, 105901, 0, 0, 0, 0, "コッコロ", 80003, 147);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, "", 6, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 148);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, "", 7, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 149);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 3, "", 9, 105901, 0, 0, 0, 0, "コッコロ", 80003, 150);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, "", 8, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 151);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, "", 10, 105901, 0, 0, 0, 0, "コッコロ", 80003, 152);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 3, "", 9, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 153);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, "", 11, 105901, 0, 0, 0, 0, "コッコロ", 80003, 154);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, "", 10, 105801, 0, 0, 0, 1, "ペコリーヌ", 80003, 155);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, "", 11, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 156);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, "", 12, 106001, 0, 0, 0, 1, "キャル", 80003, 157);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, "", 12, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 158);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, "", 13, 106001, 0, 0, 0, 1, "キャル", 80003, 159);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, "", 13, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 160);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…積極的？\nなんの話よ？", 4, "", 14, 106001, 0, 0, 0, 1, "キャル", 80003, 161);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, "", 14, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 162);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 4, "", 15, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 163);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, "", 15, 106001, 0, 0, 0, 1, "キャル", 80003, 164);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, "", 16, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 165);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, "", 16, 106001, 0, 0, 0, 1, "キャル", 80003, 166);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, "", 17, 106001, 0, 0, 0, 1, "キャル", 80003, 167);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, "", 18, 106001, 0, 0, 0, 0, "キャル", 80003, 168);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, "", 12, 105901, 0, 0, 0, 1, "コッコロ", 80003, 169);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, "", 19, 106001, 0, 0, 0, 0, "キャル", 80003, 170);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, "", 13, 105901, 0, 0, 0, 1, "コッコロ", 80003, 171);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, "", 20, 106001, 0, 0, 0, 0, "キャル", 80003, 172);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, "", 14, 105901, 0, 0, 0, 1, "コッコロ", 80003, 173);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, "", 21, 106001, 0, 0, 0, 0, "キャル", 80003, 174);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, "", 15, 105901, 0, 0, 0, 1, "コッコロ", 80003, 175);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("かくし芸？", 5, "", 22, 106001, 0, 0, 0, 0, "キャル", 80003, 176);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, "", 16, 105901, 0, 0, 0, 1, "コッコロ", 80003, 177);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, "", 23, 106001, 0, 0, 0, 0, "キャル", 80003, 178);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, "", 17, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 179);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, "", 24, 106001, 0, 0, 0, 2, "キャル", 80003, 180);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, "", 17, 105901, 0, 0, 0, 1, "コッコロ", 80003, 181);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, "", 18, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 182);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, "", 25, 106001, 0, 0, 0, 2, "キャル", 80003, 183);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, "", 18, 105901, 0, 0, 0, 1, "コッコロ", 80003, 184);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, "", 26, 106001, 0, 0, 0, 2, "キャル", 80003, 185);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, "", 27, 106001, 0, 0, 0, 2, "キャル", 80003, 186);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, "", 28, 106001, 0, 0, 0, 2, "キャル", 80003, 187);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, "", 19, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 188);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, "", 19, 105901, 0, 0, 0, 1, "コッコロ", 80003, 189);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, "", 29, 106001, 0, 0, 0, 2, "キャル", 80003, 190);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, "", 30, 106001, 0, 0, 0, 0, "キャル", 80003, 191);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, "", 31, 106001, 0, 0, 0, 0, "キャル", 80003, 192);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, "", 32, 106001, 0, 0, 0, 0, "キャル", 80003, 193);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 7, "", 33, 106001, 0, 0, 0, 0, "キャル", 80003, 194);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, "", 34, 106001, 0, 0, 0, 0, "キャル", 80003, 195);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆", 7, "", 35, 106001, 0, 0, 0, 0, "キャル", 80003, 196);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, "", 36, 106001, 0, 0, 0, 0, "キャル", 80003, 197);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, "", 37, 106001, 0, 0, 0, 0, "キャル", 80003, 198);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, "", 38, 106001, 0, 0, 0, 0, "キャル", 80003, 199);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, "", 20, 105901, 0, 0, 0, 0, "コッコロ", 80003, 200);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, "", 21, 105901, 0, 0, 0, 0, "コッコロ", 80003, 201);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, "", 22, 105901, 0, 0, 0, 0, "コッコロ", 80003, 202);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, "", 23, 105901, 0, 0, 0, 0, "コッコロ", 80003, 203);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, "", 24, 105901, 0, 0, 0, 0, "コッコロ", 80003, 204);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆", 8, "", 25, 105901, 0, 0, 0, 0, "コッコロ", 80003, 205);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, "", 26, 105901, 0, 0, 0, 0, "コッコロ", 80003, 206);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, "", 27, 105901, 0, 0, 0, 0, "コッコロ", 80003, 207);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, "", 28, 105901, 0, 0, 0, 0, "コッコロ", 80003, 208);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆", 9, "", 20, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 209);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, "", 21, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 210);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あと６日で2.5周年ですか…", 9, "", 22, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 211);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, "", 23, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 212);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, "", 24, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 213);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆", 9, "", 25, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 214);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, "", 26, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 215);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, "", 27, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 216);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, "", 28, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 217);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, "", 29, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 218);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, "", 30, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 219);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, "", 31, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 220);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, "", 29, 105901, 0, 0, 0, 1, "コッコロ", 80003, 221);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, "", 32, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 222);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…………", 10, "", 39, 106001, 0, 0, 0, 2, "キャル", 80003, 223);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, "", 30, 105901, 0, 0, 0, 1, "コッコロ", 80003, 224);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, "", 40, 106001, 0, 0, 0, 2, "キャル", 80003, 225);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, "", 33, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 226);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, "", 41, 106001, 0, 0, 0, 2, "キャル", 80003, 227);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, "", 34, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 228);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, "", 35, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 229);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, "", 42, 106001, 0, 0, 0, 2, "キャル", 80003, 230);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, "", 31, 105901, 0, 0, 0, 1, "コッコロ", 80003, 231);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, "", 43, 106001, 0, 0, 0, 2, "キャル", 80003, 232);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, "", 36, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 233);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, "", 6, 190801, 0, 0, 0, 0, "カリン", 80003, 234);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, "", 7, 190801, 0, 0, 0, 0, "カリン", 80003, 235);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, "", 8, 190801, 0, 0, 0, 0, "カリン", 80003, 236);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, "", 9, 190801, 0, 0, 0, 0, "カリン", 80003, 237);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, "", 10, 190801, 0, 0, 0, 0, "カリン", 80003, 238);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 11, "", 11, 190801, 0, 0, 0, 0, "カリン", 80003, 239);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, "", 12, 190801, 0, 0, 0, 0, "カリン", 80003, 240);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, "", 13, 190801, 0, 0, 0, 0, "カリン", 80003, 241);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あれ？\nもしかして緊張で気を失って…？", 11, "", 14, 190801, 0, 0, 0, 0, "カリン", 80003, 242);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, "", 15, 190801, 0, 0, 0, 0, "カリン", 80003, 243);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, "", 16, 190801, 0, 0, 0, 0, "カリン", 80003, 244);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それでは\nまた明日お会いしましょう♪", 11, "", 17, 190801, 0, 0, 0, 0, "カリン", 80003, 245);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, "", 44, 106001, 0, 0, 0, 0, "キャル", 80003, 246);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, "", 37, 105801, 0, 0, 0, 2, "ペコリーヌ", 80003, 247);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, "", 32, 105901, 0, 0, 0, 1, "コッコロ", 80003, 248);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, "", 45, 106001, 0, 0, 0, 0, "キャル", 80003, 249);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ひどいですよぉキャルちゃ～ん！", 12, "", 38, 105801, 0, 0, 0, 2, "ペコリーヌ", 80003, 250);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, "", 33, 105901, 0, 0, 0, 1, "コッコロ", 80003, 251);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, "", 39, 105801, 0, 0, 0, 2, "ペコリーヌ", 80003, 252);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, "", 46, 106001, 0, 0, 0, 0, "キャル", 80003, 253);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, "", 34, 105901, 0, 0, 0, 1, "コッコロ", 80003, 254);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, "", 40, 105801, 0, 0, 0, 2, "ペコリーヌ", 80003, 255);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, "", 41, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 256);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, "", 47, 106001, 0, 0, 0, 2, "キャル", 80003, 257);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("忘れてきちゃいました☆", 13, "", 42, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 258);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, "", 48, 106001, 0, 0, 0, 2, "キャル", 80003, 259);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, "", 35, 105901, 0, 0, 0, 1, "コッコロ", 80003, 260);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, "", 49, 106001, 0, 0, 0, 2, "キャル", 80003, 261);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, "", 43, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 262);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, "", 50, 106001, 0, 0, 0, 2, "キャル", 80003, 263);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, "", 36, 105901, 0, 0, 0, 1, "コッコロ", 80003, 264);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, "", 51, 106001, 0, 0, 0, 2, "キャル", 80003, 265);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, "", 37, 105901, 0, 0, 0, 1, "コッコロ", 80003, 266);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, "", 52, 106001, 0, 0, 0, 2, "キャル", 80003, 267);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, "", 44, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 268);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, "", 38, 105901, 0, 0, 0, 1, "コッコロ", 80003, 269);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, "", 45, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 270);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, "", 53, 106001, 0, 0, 0, 2, "キャル", 80003, 271);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, "", 46, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 272);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 14, "", 18, 190801, 0, 0, 0, 0, "カリン", 80003, 273);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 14, "", 19, 190801, 0, 0, 0, 0, "カリン", 80003, 274);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, "", 20, 190801, 0, 0, 0, 0, "カリン", 80003, 275);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, "", 21, 190801, 0, 0, 0, 0, "カリン", 80003, 276);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, "", 22, 190801, 0, 0, 0, 0, "カリン", 80003, 277);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, "", 23, 190801, 0, 0, 0, 0, "カリン", 80003, 278);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, "", 24, 190801, 0, 0, 0, 0, "カリン", 80003, 279);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, "", 25, 190801, 0, 0, 0, 0, "カリン", 80003, 280);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, "", 26, 190801, 0, 0, 0, 0, "カリン", 80003, 281);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, "", 27, 190801, 0, 0, 0, 0, "カリン", 80003, 282);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("準備はいいですかっ？\n…いっきますよー！", 15, "", 47, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 283);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("祝！", 15, "", 54, 106001, 0, 0, 0, 2, "キャル", 80003, 284);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年！", 15, "", 39, 105901, 0, 0, 0, 1, "コッコロ", 80003, 285);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おめでとうございま～す☆", 15, "", 48, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 286);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, "", 55, 106001, 0, 0, 0, 2, "キャル", 80003, 287);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, "", 40, 105901, 0, 0, 0, 1, "コッコロ", 80003, 288);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, "", 49, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 289);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, "", 56, 106001, 0, 0, 0, 2, "キャル", 80003, 290);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, "", 41, 105901, 0, 0, 0, 1, "コッコロ", 80003, 291);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, "", 57, 106001, 0, 0, 0, 2, "キャル", 80003, 292);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, "", 50, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 293);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, "", 58, 106001, 0, 0, 0, 2, "キャル", 80003, 294);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 15, "", 51, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 295);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("意味分かんないわよ！", 15, "", 59, 106001, 0, 0, 0, 2, "キャル", 80003, 296);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, "", 42, 105901, 0, 0, 0, 1, "コッコロ", 80003, 297);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, "", 43, 105901, 0, 0, 0, 1, "コッコロ", 80003, 298);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, "", 52, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 299);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, "", 60, 106001, 0, 0, 0, 2, "キャル", 80003, 300);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, "", 44, 105901, 0, 0, 0, 1, "コッコロ", 80003, 301);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, "", 53, 105801, 0, 0, 0, 0, "ペコリーヌ", 80003, 302);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("2.5周年\nありがとうございます！", 15, "105901,45,106001,61", 54, 105801, 1, 0, 0, 0, "ペコリーヌ・コッコロ・キャル", 80003, 303);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 1, 190804, 0, 0, 1, 1, "カリン", 60002, 304);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, "", 0, 0, 0, 1, 1, 2, "", 60002, 305);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, "", 0, 0, 0, 1, 1, 2, "", 60002, 306);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, "", 0, 0, 0, 1, 1, 2, "", 60002, 307);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, "", 0, 0, 0, 1, 1, 2, "", 60002, 308);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, "", 0, 0, 0, 1, 2, 2, "", 60002, 309);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, "", 0, 0, 0, 2, 1, 2, "", 60002, 310);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, "", 0, 0, 0, 2, 1, 2, "", 60002, 311);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, "", 0, 0, 0, 2, 1, 2, "", 60002, 312);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, "", 0, 0, 0, 2, 1, 2, "", 60002, 313);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, "", 0, 0, 0, 2, 2, 2, "", 60002, 314);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 315);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 316);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 317);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 318);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 319);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, "", 0, 0, 0, 3, 1, 2, "", 60002, 320);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, "", 0, 0, 0, 3, 2, 2, "", 60002, 321);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 322);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 323);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 324);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 325);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 326);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, "", 0, 0, 0, 4, 1, 2, "", 60002, 327);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, "", 0, 0, 0, 4, 2, 2, "", 60002, 328);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 2, 190804, 0, 0, 0, 3, "カリン", 60002, 329);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, "", 3, 190804, 0, 0, 0, 3, "カリン", 60002, 330);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ささ、シェフィさまはこちらへ…", 1, "", 1, 105901, 0, 0, 0, 4, "コッコロ", 80005, 331);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 1, "", 1, 106401, 0, 0, 0, 0, "シェフィ", 80005, 332);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, "", 1, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 333);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, "", 2, 105901, 0, 0, 0, 4, "コッコロ", 80005, 334);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええと…\n二人とも何をしているの？", 1, "", 2, 106401, 0, 0, 0, 0, "シェフィ", 80005, 335);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, "", 1, 106001, 0, 0, 0, 1, "キャル", 80005, 336);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あの日…？", 1, "", 3, 106401, 0, 0, 0, 0, "シェフィ", 80005, 337);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, "", 2, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 338);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, "", 3, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 339);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("やばいですね☆", 1, "", 1, 190801, 0, 0, 0, 2, "カリン", 80005, 340);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("って、なにしれっと\n参加してんのよカリン！", 1, "", 2, 106001, 0, 0, 0, 1, "キャル", 80005, 341);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, "", 2, 190801, 0, 0, 0, 2, "カリン", 80005, 342);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, "", 3, 190801, 0, 0, 0, 2, "カリン", 80005, 343);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, "", 4, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 344);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 1, "", 4, 106401, 0, 0, 0, 0, "シェフィ", 80005, 345);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, "", 5, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 346);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, "", 3, 105901, 0, 0, 0, 1, "コッコロ", 80005, 347);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, "", 4, 105901, 0, 0, 0, 1, "コッコロ", 80005, 348);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, "", 6, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 349);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さすがでございます\nペコリーヌさま", 2, "", 5, 105901, 0, 0, 0, 1, "コッコロ", 80005, 350);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, "", 3, 106001, 0, 0, 0, 0, "キャル", 80005, 351);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 2, "", 5, 106401, 0, 0, 0, 2, "シェフィ", 80005, 352);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, "", 7, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 353);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さ、次はキャルさまの\n番でございますよ", 2, "", 6, 105901, 0, 0, 0, 1, "コッコロ", 80005, 354);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, "", 4, 106001, 0, 0, 0, 0, "キャル", 80005, 355);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, "", 6, 106401, 0, 0, 0, 2, "シェフィ", 80005, 356);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, "", 5, 106001, 0, 0, 0, 0, "キャル", 80005, 357);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, "", 6, 106001, 0, 0, 0, 0, "キャル", 80005, 358);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, "", 7, 105901, 0, 0, 0, 1, "コッコロ", 80005, 359);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, "", 7, 106001, 0, 0, 0, 0, "キャル", 80005, 360);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, "", 8, 105901, 0, 0, 0, 1, "コッコロ", 80005, 361);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, "", 8, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 362);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, "", 9, 105901, 0, 0, 0, 1, "コッコロ", 80005, 363);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("聖学祭…って、なにかしら？", 3, "", 7, 106401, 0, 0, 0, 2, "シェフィ", 80005, 364);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, "", 10, 105901, 0, 0, 0, 1, "コッコロ", 80005, 365);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, "", 8, 106001, 0, 0, 0, 0, "キャル", 80005, 366);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, "", 9, 106001, 0, 0, 0, 0, "キャル", 80005, 367);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, "", 9, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 368);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いや、そのまんますぎでしょ…", 3, "", 10, 106001, 0, 0, 0, 0, "キャル", 80005, 369);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, "", 8, 106401, 0, 0, 0, 2, "シェフィ", 80005, 370);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, "", 10, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 371);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっ？　ええ…\nぎゅーっ…？", 3, "", 9, 106401, 0, 0, 0, 2, "シェフィ", 80005, 372);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, "", 11, 106001, 0, 0, 0, 0, "キャル", 80005, 373);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, "", 10, 106401, 0, 0, 0, 2, "シェフィ", 80005, 374);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, "", 12, 106001, 0, 0, 0, 0, "キャル", 80005, 375);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, "", 11, 105901, 0, 0, 0, 1, "コッコロ", 80005, 376);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, "", 13, 106001, 0, 0, 0, 0, "キャル", 80005, 377);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, "", 11, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 378);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, "", 14, 106001, 0, 0, 0, 0, "キャル", 80005, 379);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, "", 15, 106001, 0, 0, 0, 0, "キャル", 80005, 380);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, "", 11, 106401, 0, 0, 0, 2, "シェフィ", 80005, 381);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, "", 12, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 382);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, "", 12, 105901, 0, 0, 0, 1, "コッコロ", 80005, 383);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, "", 16, 106001, 0, 0, 0, 0, "キャル", 80005, 384);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, "", 12, 106401, 0, 0, 0, 2, "シェフィ", 80005, 385);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, "", 13, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 386);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, "", 14, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 387);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, "", 15, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 388);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, "", 17, 106001, 0, 0, 0, 0, "キャル", 80005, 389);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, "", 18, 106001, 0, 0, 0, 0, "キャル", 80005, 390);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, "", 13, 106401, 0, 0, 0, 2, "シェフィ", 80005, 391);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, "", 13, 105901, 0, 0, 0, 1, "コッコロ", 80005, 392);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, "", 16, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 393);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, "", 19, 106001, 0, 0, 0, 0, "キャル", 80005, 394);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, "", 17, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 395);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, "", 18, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 396);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, "", 19, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 397);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, "", 4, 190801, 0, 0, 0, 2, "カリン", 80005, 398);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, "", 5, 190801, 0, 0, 0, 2, "カリン", 80005, 399);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…えっ！？", 6, "", 20, 106001, 0, 0, 0, 1, "キャル", 80005, 400);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, "", 20, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 401);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, "", 14, 106401, 0, 0, 0, 0, "シェフィ", 80005, 402);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, "", 14, 105901, 0, 0, 0, 4, "コッコロ", 80005, 403);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, "", 15, 106401, 0, 0, 0, 0, "シェフィ", 80005, 404);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, "", 21, 106001, 0, 0, 0, 1, "キャル", 80005, 405);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, "", 21, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 406);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ぶっ殺すぞ！？", 6, "", 22, 106001, 0, 0, 0, 1, "キャル", 80005, 407);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, "", 6, 190801, 0, 0, 0, 2, "カリン", 80005, 408);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, "", 15, 105901, 0, 0, 0, 1, "コッコロ", 80005, 409);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, "", 23, 106001, 0, 0, 0, 0, "キャル", 80005, 410);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, "", 16, 106401, 0, 0, 0, 2, "シェフィ", 80005, 411);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, "", 22, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 412);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, "", 24, 106001, 0, 0, 0, 0, "キャル", 80005, 413);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, "", 17, 106401, 0, 0, 0, 2, "シェフィ", 80005, 414);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, "", 16, 105901, 0, 0, 0, 1, "コッコロ", 80005, 415);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, "", 18, 106401, 0, 0, 0, 2, "シェフィ", 80005, 416);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 7, "", 17, 105901, 0, 0, 0, 1, "コッコロ", 80005, 417);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("しれっと教育ママが\n生まれてる…？", 7, "", 25, 106001, 0, 0, 0, 0, "キャル", 80005, 418);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, "", 23, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 419);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("え～～～～！？", 7, "", 26, 106001, 0, 0, 0, 0, "キャル", 80005, 420);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, "", 27, 106001, 0, 0, 0, 0, "キャル", 80005, 421);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, "", 19, 106401, 0, 0, 0, 2, "シェフィ", 80005, 422);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, "", 18, 105901, 0, 0, 0, 1, "コッコロ", 80005, 423);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, "", 24, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 424);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, "", 20, 106401, 0, 0, 0, 2, "シェフィ", 80005, 425);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, "", 28, 106001, 0, 0, 0, 0, "キャル", 80005, 426);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, "", 19, 105901, 0, 0, 0, 1, "コッコロ", 80005, 427);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, "", 21, 106401, 0, 0, 0, 2, "シェフィ", 80005, 428);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, "", 29, 106001, 0, 0, 0, 0, "キャル", 80005, 429);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, "", 30, 106001, 0, 0, 0, 0, "キャル", 80005, 430);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, "", 25, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 431);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, "", 31, 106001, 0, 0, 0, 0, "キャル", 80005, 432);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, "", 22, 106401, 0, 0, 0, 0, "シェフィ", 80005, 433);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 9, "", 23, 106401, 0, 0, 0, 0, "シェフィ", 80005, 434);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, "", 24, 106401, 0, 0, 0, 0, "シェフィ", 80005, 435);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, "", 25, 106401, 0, 0, 0, 0, "シェフィ", 80005, 436);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, "", 26, 106401, 0, 0, 0, 0, "シェフィ", 80005, 437);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 9, "", 27, 106401, 0, 0, 0, 0, "シェフィ", 80005, 438);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("―びえぇぇ～んっ！！！", 9, "", 28, 106401, 0, 0, 0, 0, "シェフィ", 80005, 439);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("どうされましたか、シェフィさま", 9, "", 20, 105901, 0, 0, 0, 1, "コッコロ", 80005, 440);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ううっ…ひっく…\nママッ…！", 9, "", 29, 106401, 0, 0, 0, 0, "シェフィ", 80005, 441);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, "", 21, 105901, 0, 0, 0, 1, "コッコロ", 80005, 442);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, "", 22, 105901, 0, 0, 0, 1, "コッコロ", 80005, 443);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, "", 30, 106401, 0, 0, 0, 0, "シェフィ", 80005, 444);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("主さま\n3.5周年まであと５日\nでございます", 10, "", 23, 105901, 0, 0, 0, 0, "コッコロ", 80005, 445);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですがその前に\n生放送がありますね", 10, "", 24, 105901, 0, 0, 0, 0, "コッコロ", 80005, 446);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…生放送に向けた\n意気込みでございますか？", 10, "", 25, 105901, 0, 0, 0, 0, "コッコロ", 80005, 447);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, "", 26, 105901, 0, 0, 0, 0, "コッコロ", 80005, 448);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, "", 27, 105901, 0, 0, 0, 0, "コッコロ", 80005, 449);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, "", 28, 105901, 0, 0, 0, 0, "コッコロ", 80005, 450);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, "", 29, 105901, 0, 0, 0, 0, "コッコロ", 80005, 451);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, "", 30, 105901, 0, 0, 0, 0, "コッコロ", 80005, 452);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, "", 31, 105901, 0, 0, 0, 0, "コッコロ", 80005, 453);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと４日！\nやばいですね☆", 11, "", 26, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 454);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, "", 32, 106001, 0, 0, 0, 1, "キャル", 80005, 455);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, "", 27, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 456);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, "", 28, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 457);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, "", 29, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 458);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, "", 33, 106001, 0, 0, 0, 1, "キャル", 80005, 459);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, "", 30, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 460);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, "", 31, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 461);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, "", 32, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 462);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("だからあたしはやるなんて一言も…", 11, "", 34, 106001, 0, 0, 0, 1, "キャル", 80005, 463);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("オイッスー☆", 11, "", 33, 105801, 0, 0, 0, 0, "ペコリーヌ", 80005, 464);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("聞きなさいっての！！", 11, "", 35, 106001, 0, 0, 0, 1, "キャル", 80005, 465);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 12, "", 31, 106401, 0, 0, 0, 2, "シェフィ", 80005, 466);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, "", 32, 106401, 0, 0, 0, 2, "シェフィ", 80005, 467);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 12, "", 33, 106401, 0, 0, 0, 2, "シェフィ", 80005, 468);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, "", 34, 106401, 0, 0, 0, 2, "シェフィ", 80005, 469);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, "", 35, 106401, 0, 0, 0, 2, "シェフィ", 80005, 470);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("やってますねシェフィちゃん！", 12, "", 34, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 471);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なによ、考えることは\nみんな同じってこと？", 12, "", 36, 106001, 0, 0, 0, 0, "キャル", 80005, 472);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, "", 32, 105901, 0, 0, 0, 1, "コッコロ", 80005, 473);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("みんな…もちろんよ！", 12, "", 36, 106401, 0, 0, 0, 2, "シェフィ", 80005, 474);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, "", 35, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 475);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, "", 7, 190801, 0, 0, 0, 2, "カリン", 80005, 476);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, "", 8, 190801, 0, 0, 0, 2, "カリン", 80005, 477);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, "", 36, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 478);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, "", 9, 190801, 0, 0, 0, 2, "カリン", 80005, 479);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, "", 33, 105901, 0, 0, 0, 4, "コッコロ", 80005, 480);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, "", 10, 190801, 0, 0, 0, 2, "カリン", 80005, 481);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 13, "", 37, 106001, 0, 0, 0, 1, "キャル", 80005, 482);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, "", 11, 190801, 0, 0, 0, 2, "カリン", 80005, 483);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あうー？", 13, "", 37, 106401, 0, 0, 0, 0, "シェフィ", 80005, 484);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("あ…", 13, "105901,34,106001,38,190801,12", 37, 105801, 1, 0, 0, 4, "みんな", 80005, 485);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, "", 39, 106001, 0, 0, 0, 1, "キャル", 80005, 486);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, "", 35, 105901, 0, 0, 0, 4, "コッコロ", 80005, 487);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, "", 38, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 488);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, "", 13, 190801, 0, 0, 0, 2, "カリン", 80005, 489);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, "", 38, 106401, 0, 0, 0, 2, "シェフィ", 80005, 490);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, "", 39, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 491);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, "", 40, 106001, 0, 0, 0, 0, "キャル", 80005, 492);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, "", 36, 105901, 0, 0, 0, 1, "コッコロ", 80005, 493);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, "", 39, 106401, 0, 0, 0, 2, "シェフィ", 80005, 494);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, "", 40, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 495);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, "", 37, 105901, 0, 0, 0, 1, "コッコロ", 80005, 496);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, "", 41, 106001, 0, 0, 0, 0, "キャル", 80005, 497);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("へ、へぇ…", 14, "", 40, 106401, 0, 0, 0, 2, "シェフィ", 80005, 498);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, "", 41, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 499);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, "", 41, 106401, 0, 0, 0, 2, "シェフィ", 80005, 500);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, "", 42, 106401, 0, 0, 0, 2, "シェフィ", 80005, 501);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, "", 42, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 502);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("祝！", 15, "", 42, 106001, 0, 0, 0, 1, "キャル", 80005, 503);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("3.5周年！", 15, "", 38, 105901, 0, 0, 0, 4, "コッコロ", 80005, 504);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("おめでとうございます！", 15, "", 43, 106401, 0, 0, 0, 0, "シェフィ", 80005, 505);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, "", 14, 190801, 0, 0, 0, 2, "カリン", 80005, 506);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, "", 15, 190801, 0, 0, 0, 2, "カリン", 80005, 507);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, "", 43, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 508);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, "", 44, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 509);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, "", 43, 106001, 0, 0, 0, 1, "キャル", 80005, 510);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, "", 44, 106001, 0, 0, 0, 1, "キャル", 80005, 511);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, "", 44, 106401, 0, 0, 0, 0, "シェフィ", 80005, 512);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, "", 45, 106401, 0, 0, 0, 0, "シェフィ", 80005, 513);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, "", 39, 105901, 0, 0, 0, 4, "コッコロ", 80005, 514);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, "", 40, 105901, 0, 0, 0, 4, "コッコロ", 80005, 515);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, "", 41, 105901, 0, 0, 0, 4, "コッコロ", 80005, 516);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, "", 45, 105801, 0, 0, 0, 3, "ペコリーヌ", 80005, 517);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("これからも\nよろしくおねがいします！", 15, "105901,42,106001,45,106401,46,190801,16", 46, 105801, 1, 0, 0, 4, "みんな", 80005, 518);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 1, 190804, 0, 0, 1, 1, "カリン", 60003, 519);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, "", 0, 0, 0, 1, 1, 2, "", 60003, 520);
