INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, "", 0, 0, 0, 1, 1, 2, "", 60003, 522);
